import { setToken as _setToken, getToken } from '@/libs/util';
export default {
  state: {
    username: '',
    email: '',
    userId: '',
    avatarImgPath: '',
    token: getToken(),
    access: '',
    hasGetInfo: false
  },
  mutations: {
    setAvatar: function setAvatar(state, avatarPath) {
      state.avatarImgPath = avatarPath;
    },
    setUserId: function setUserId(state, id) {
      state.userId = id;
    },
    setUserName: function setUserName(state, name) {
      state.username = name;
    },
    setUserEmail: function setUserEmail(state, email) {
      state.email = email;
    },
    setAccess: function setAccess(state, access) {
      state.access = access;
    },
    setToken: function setToken(state, token) {
      state.token = token;

      _setToken(token);
    },
    setHasGetInfo: function setHasGetInfo(state, status) {
      state.hasGetInfo = status;
    }
  },
  getters: {
    imagename: function imagename(state) {
      return state.avatarImgPath;
    }
  }
};
